INSERT INTO `point_presentasi` (`id`, `point_penilaian`, `score_maksimal`, `pertanyaan_id`, `active`) VALUES
	(64, 'Tidak berhubungan dengan tujuan (strategi) perusahaan dan tidak terlihat urgensi atau  tingkat kepentingan permasalahan (bukan sebagai KPI yang paling critical untuk diperbaiki, tidak menjadi temuan audit, tidak terdapat dalam risk register, bukan merupakan complaint atau voice of customer) ', '5', 54, b'0'),
	(65, 'Permasalahan merupakan sesuatu yang urgen untuk diperbaiki, namun tidak terlihat kepentingannya dari perspektif organisasi atau perusahaan (bukan merupakan bagian dari strategi, bukan sebagai KPI yang paling critical untuk diperbaiki, tidak menjadi temuan audit, tidak terdapat dalam risk register, bukan merupakan complaint atau voice of customer)', '10', 54, b'0'),
	(66, 'Permasalahan merupakan sesuatu yang urgent untuk diperbaiki, dan penting  untuk segera diperbaiki dari perspektif organisasi atau perusahaan  (salah satu atau lebih dari : bagian dari strategi, KPI yang paling critical untuk diperbaiki, temuan audit,  terdapat dalam risk register,  merupakan complaint atau voice of customer)', '15', 54, b'0'),
	(67, 'Permasalahan merupakan sesuatu terkait dengan strategi dan urgent untuk diperbaiki (dan (merupakan KPI yang paling critical untuk diperbaiki, temuan audit,  terdapat dalam risk register,  merupakan complaint atau voice of customer)', '20', 54, b'0'),
	(68, 'Setiap akar penyebab hanya tersedia satu solusi tanpa adanya pertimbangan / penjelasan dari aspek manfaat atau efektifiastnya, biaya yang dibutuhkan dan aspek teknis lainnya, serta terdapat timeline due date implementasi yang jelas dan PIC pelaksananya (5W2H+1T - What, How, Why, When, Where, Who, How Much+Target)', '5', 55, b'1'),
	(69, 'Setiap akar penyebab hanya tersedia satu solusi, dilakukan analisa, namun analisa untuk memilih solusi tidak dilakukan dengan baik atau hanya memperhitungkan sebagian dari  aspek manfaat atau efektifitastnya, biaya yang dibutuhkan dan aspek teknis lainnya, serta terdapat timeline  due date implementasi yang jelas dan PIC pelaksananya (5W2H1T - What, How, Why, When, Where, Who, How Much+ Target)', '10', 55, b'1'),
	(70, 'Ter identifikasi proses penentuan  masalah-masalah pada analisa kondisi yang ada (anakonda) dan dilakukan dengan baik,spesifik ke masalahnya serta komprehensif (tidak ada yang tertinggal tidak dianalisa, mencakup semua aspek 4M1E-Man,Machine, Method, Material, Environment),dan analisa sebab akibat (why-why) runut sehingga akar penyebab dapat diidentifikasi,dibuktikan,dijelaskan,akar penyebab yang mana yang memberi kontribusi terbesar terhadap permasalahan.dan memilih solusi yang dipilih tidak dilakukan dengan baik atau hanya memperhitungkan sebagian dari  aspek manfaat atau efektifitasnya, biaya yang dibutuhkan dan aspek teknis lainnya, serta terdapat timeline  due date implementasi yang jelas dan PIC pelaksananya (5W2H+1T - What, How, Why, When, Where, Who, How Much + Target)', '15', 55, b'1'),
	(71, 'Ter identifikasi proses penentuan  masalah-masalah pada analisa kondisi yang ada (anakonda) dan dilakukan dengan baik,spesifik ke masalahnya serta komprehensif (tidak ada yang tertinggal tidak dianalisa, mencakup semua aspek 4M1E-Man,Machine, Method, Material, Environment),dan analisa sebab akibat (why-why) runut sehingga akar penyebab dapat diidentifikasi,dibuktikan,dijelaskan,akar penyebab yang mana yang memberi kontribusi terbesar terhadap permasalahan.dan adanya opsi opsi/solusi-solusi  perbaikan yang akan dilakukan pada setiap akar penyebab serta memilih solusi yang dipilih dilakukan dengan baik  dari  aspek teknis, manfaat , efektifitas,biaya yang dibutuhkan , serta terdapat timeline  due date implementasi yang jelas dan PIC pelaksananya (5W2H+1T - What, How, Why, When, Where, Who, How Much + Target)', '20', 55, b'1'),
